import React from 'react';
import "./Header.css";
import{ Link } from "react-router-dom";

function Header() {
  return ( 
  <nav className="header">
      <Link to="./login">    
      <img
       className="header__logo" 
       src="https://pngimg.com/uploads/amazon/amazon_PNG25.png"
       alt="Amazon logo"/>
      </Link> 
    </nav>
  );
  
}

export default Header;
